script: |
  super -f tsv -I q833.sql | sort > q833.out

vector: true

inputs:
  - name: q833.sql
    data: |
      SELECT DISTINCT - cor0.col1 + NULLIF ( col2, - CASE - col1 WHEN + cor0.col1 / + cor0.col0 THEN - cor0.col2 END * - 11 ) AS col1 FROM tab2 AS cor0 GROUP BY cor0.col2, col0, cor0.col1;
  - name: tab2

outputs:
  - name: q833.out
    data: |
      17
      20
      26
